import React from 'react';
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';
import { Game, QuarterbackPerformanceLineChartDatapoint } from '../types/PlayerDashboardTypes';

type PlayerDashboardGamePerformanceLineChartProps = {
  data: Game[]
}

export default ({ data }: PlayerDashboardGamePerformanceLineChartProps) => {
  const dataThisSeason = data.filter((g: Game) => g.seasonYear === 2019);
  const transformedDataThisSeason = transformData(dataThisSeason);

  console.log(transformedDataThisSeason);

  return (
    <LineChart width={600} height={300} data={transformedDataThisSeason}>
      <Line type="monotone" dataKey="passingCompletionPctg" stroke="#8884a8" />
      <Line type="monotone" dataKey="passingCompletionsAmt" stroke="#8867a8" />
      <CartesianGrid stroke="#ccc" />
      <XAxis dataKey="gameId" />
      <YAxis dataKey="passingCompletionPctg" />
      <YAxis dataKey="passingCompletionsAmt" />
      <Tooltip />
    </LineChart>
  )
}

function transformData(games: Game[]): QuarterbackPerformanceLineChartDatapoint[] {
  return games.map((game: Game) => {
    const passingCompletionPctgRaw = 100 * (game.passingCompletionsAmt / game.passingAttemptsAmt);
    const passingCompletionPctg = passingCompletionPctgRaw.toFixed(2);
    return {
      ...game,
      passingCompletionPctg
    }
  })
}
